  let slugText = slugify(location_name)
  let city = keys_city.find((city) => {
    return slugText.indexOf(city) !== -1
  })
  if (city) {
    return cities[city]
  }
  let district = keys_district.find((city) => {
    return slugText.indexOf(city) !== -1
  })
  if (district) {
    return district_city[district]
  }
  return location_name
}

